\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHere, you can take a look at the New England Journal of Medicine . Lots of interesting stuff in there.\n\nDecember 3, 2014\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn LEGOs “Listen, I don’t want to stifle your creativity, but that thing you built there, it looks like a pile of shit.”\n\nDecember 3, 2014\n\u001c26\n\u0011\n\u0011\n\n\nDo Not Be a Goddamned Liar\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow, experiments start with a question. What do you want to know?” I thought about it for a few seconds. “I think the dog is cool,” I said, motioning toward Brownie, our five-year-old chocolate Lab mix. “What? What the hell does that mean? That’s not a fucking question.” “What if I said: Do people think the dog is cool?” “Jesus fucking Christ,” he said\n\nDecember 3, 2014\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m sorry I had to be so hard on you, but I don’t want people thinking you’re a lying sack of shit. You ain’t. You’re a quality human being. Now go to your room, you’re grounded.”\n\nDecember 3, 2014\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn Fair Play “Cheating’s not easy. You probably think it is, but it ain’t. I bet you’d suck more at cheating than whatever it was you were trying to do legitimately.”\n\nDecember 3, 2014\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou always have the right to be an asshole—you just shouldn’t use that right very often.”\n\nDecember 3, 2014\n\u001c33\n\u0011\n\u0011\n\n\nAt the End of the Day, You Have to Make the Best Decision for Yourself\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYour penis betrayed you, son. Made you think stupid. It won’t be the last time that happens.”\n\nDecember 3, 2014\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNobody likes practice, but what’s worse: practicing, or sucking at something?\n\nDecember 3, 2014\n\u001c57\n\u0011\n\u0011\n\n\nConfidence Is the Way to a Woman’s Heart, or at Least into Her Pants\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut if you give a shit about what a bunch of people in Denny’s think about you, then the rest of what I was gonna say doesn’t even matter.” I told him to stop reading his newspaper, and he put it on the greasy table and looked me in the eye. “So is that why you took me here? Some kind of test to see if I’d get embarrassed?” “Son, do I look like the type with a master fucking plan? I just wanted to talk to you and eat some eggs. Let me finish doing one of them.”\n\nDecember 3, 2014\n\u001c62\n\u0011\n\u0011\n\n\nAlways Put Your Best Foot Forward\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn Remaining a Gentleman No Matter the Situation “I personally would never go to a prostitute, but if you’ve paid money for some strange, that doesn’t mean you can act like an idiot once you get it.”\n\nDecember 4, 2014\n\u001c68\n\u0011\n\u0011\n\n\nYou Have to Believe You’re Worth a Damn\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis is complete fucking bullshit!” he screamed. At that point I left the living room and tried to hide in the hallway so I could still listen. “Out of your league?! What fucking league are you talking about?! You are a man, she is a fucking woman! That is all that matters, goddamn it!”\n\nDecember 4, 2014\n\u001c72\n\u0011\n\u0011\n\n\nDon’t Be So Quick to Buy into What Authority Prescribes\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn Furnishing One’s Home “Pick your furniture like you pick a wife; it should make you feel comfortable and look nice, but not so nice that if someone walks past it they want to steal it.”\n\nDecember 5, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn Living on a Budget “Why are you going over your monthly expenses?…No, let me shorten this process for you: You make dog shit, so don’t spend any money.”\n\nDecember 5, 2014\n\u001c86\n\u0011\n\u0011\n\n\nYou Never Stop Worrying About Your Children\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEven though he wouldn’t admit it, I always knew my dad was happy to see me when I came home. I’d usually head over at night, when he was home from work, and we’d have a nice chat about things that were going on in each other’s lives. It was the first time I had ever f\n\nDecember 5, 2014\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clike I had an adult relationship with my dad. We were growing closer and becoming friends. I realized that we’d really broken down some barriers one evening in late June when he asked me to help him with a project in his garden that Friday. “Friday, come over at four. Don’t be late, I don’t want to be fucking with this after dark. I’ll buy you dinner afterwards,” he offered. Since he’d purchased the house in 1972, my dad’s garden had taken over almost every spare inch of our yards, front and back, and he’d planted not only flowers but tomatoes, lettuce, even corn. He loved his garden and spent most of his free time taking meticulous care of it. He was also very particular about who touched it. That Friday he was going to put up some fencing to grow tomatoes, a difficult job for one guy. He normally did the tough jobs on his own anyway. One time many years earlier I had\n\nDecember 5, 2014\n\u001c88\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1LYwuI2jDvl2mTNioUtuyGx9puXHj3vaeCZzNNPI","i_cont":0.0,"i_opa":1