s_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3931,"ei":3948,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3949,"ei":4831,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4832,"ei":4849,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4850,"ei":4855,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="yt4WduqV90Hhtp+p5PcEgzhU7NM"  nonce="yt4WduqV90Hhtp+p5PcEgzhU7NM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="yt4WduqV90Hhtp+p5PcEgzhU7NM"  nonce="yt4WduqV90Hhtp+p5PcEgzhU7NM">DOCS_modelChunk = [{"ty":"is","ibi":4856,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001con his garden that coming Friday, the request meant a lot to me. He didn’t need my help—he wanted it. On Thursday, the night before I was supposed to help him out, I was studying with a girl named Stacy from my communications class. We were taking a summer school course because each of us had dropped a class during the school year. I had been in a few classes with Stacy before and had developed a major crush on her. I had never asked her out or even hinted at my feelings, mostly because she had a boyfriend, but even if she hadn’t, I doubt I would have gotten up the courage to make a move.\n\nDecember 5, 2014\n\u001c89\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou little shit,” he said. “I can’t wait till you have some kid and you got to worry about what happens to him. You never stop worrying about your children. It sucks. You watch what you stick your dick into, because this is your life, this bullshit right here.” He released me from the hug and grabbed a plastic grocery bag filled with chips. “Grab that bottle of ketchup, we’re late for the barbecue your uncle is throwing.” “I was going to meet Dan at the beach, actually,” I said tentatively, hoping he would respect my Fourth of July plans. “Shut the fuck up and grab the bag. You got some balls\n\nDecember 5, 2014\n\u001c94\n\u0011\n\u0011\n\n\nAt the End of the Day, at Least You Have Family\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFrom now on, when I ask you how you’re doing, I appreciate you being open, but don’t tell me stories about you jerking off to your gay neighbors,” he said, laughing. “Listen, you’ve only been up there a month. This shit takes time. Steven Spielberg didn’t become Steven Spielberg in a month. He was probably just some asshole who’s a l\n\nDecember 5, 2014\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy parents wanted me to feel good about myself, and they knew that I wasn’t going to have a shot at being successful unless I did. I wasn’t Charles Bukowski; my misery was not going to translate to literary genius and royalty checks. My dad ended the phone call with one emphatic sentence. “I’m taking you to Lawry’s Prime Beef!” Lawry’s is mostly known for its seasoned salt, which you can purchase in almost any large grocery store, but they also have a famous steak house, Lawry’s The Prime Rib Restaurant, in Los Angeles, which my dad loves\n\nDecember 5, 2014\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“To you guys. For sticking your asses out on the line and going after it. And to Justin for getting a new job.” I never would have thought a person could so energetically toast a job that paid minimum wage, but my dad’s pride was completely genuine.\n\nDecember 5, 2014\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cas a waiter for five of them—I can tell you that we operate the same way a stripper does: Give us money, and we’ll pretend we like you. After our waitress saw the tip, she sashayed back to the table and began chatting us up even more. When my dad found out she was single, he pointed at me and said, “That one is single, too. He lives up here now. You two should get together.” (Because if there’s any indication that two people should begin having sexual intercourse, it’s that they live in the same city\n\nDecember 5, 2014\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat’s a big deal to me. You may not think things you do mean shit, but remember that they mean shit to me, okay?” “I know.” “Yeah, you know everything. That’s why you jerked off to your gay neighbors.” “Dad, we’re right in front of their apartment.” He laughed, then gave me another hug. “You always got us. We’re family. We ain’t going anywhere. Unless you go on a fucking killing spree or something.” “I would still love you, Justy. I would just want to know why you did it,” my mom said earnestly, having gotten back into the car and rolled down her window.\n\nDecember 5, 2014\n\u001c103\n\u0011\n\u0011\n\n\nYou Have to Listen, and Don’t Ignore What You Hear\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSometimes life leaves a hundred-dollar bill on your dresser, and you don’t realize until later it’s because it fucked you.”\n\nDecember 5, 2014\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeople are always trying to tell you how they feel. Some of them say it outright, and some of them, they tell you with their actions. And you have to listen. I don’t know what will happen with your lady friend. I think she’s a nice person, and I hope you get what you want. But do me a favor: Listen, and don’t ignore what you hear.”\n\nDecember 5, 2014\n\u001c114\n\u0011\n\u0011"},
}'






